import React from "react";
import Link from "next/link";

export default function Navigations() {
 return (
  <div>
   <Link href="/">
    <a>ANASAYFA</a>
   </Link>
   <Link href="/hizmetlerimiz">
    <a>HİZMETLERİMİZ</a>
   </Link>
  </div>
 );
}
